import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
const screenWidth = Dimensions.get('window').width;
const Tab = createBottomTabNavigator();
const foodCategories = [
  {
    key: 'category_1',
    name: 'Category 1',
    image: require('../assets/ramen.jpg'), // Add your image source here
  },
  {
    key: 'category_2',
    name: 'Category 2',
    image: require('../assets/ramen.jpg'), // Add your image source here
  },
  {
    key: 'category_3',
    name: 'Category 3',
    image: require('../assets/ramen.jpg'), // Add your image source here
  },
  {
    key: 'category_4',
    name: 'Category 4',
    image: require('../assets/ramen.jpg'), // Add your image source here
  },
];
const renderCategory = () => {
  return foodCategories.map((category, index) => {
    return(
    <View style={styles.category} key={`category_${index}`}>
      <Image source={category.image} style={styles.roundImage} resizeMode='contain' />
      <Text>{category.name}</Text>
    </View>)
  });
};
const MyTabs=()=> {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Home" component={HomeScreen} />
      <Tab.Screen name="Settings" component={LandingScreen} />
    </Tab.Navigator>
  );
}
const HomeScreen = () => {
  return (
    <View>
    <ScrollView style={styles.container}>
      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Popular Categories</Text>
        <ScrollView horizontal showsHorizontalScrollIndicator={false}>
          {renderCategory()}
        </ScrollView>
      </View>

      <View>
        <Text style={{...styles.sectionTitle, margin: 10,}}>Best Deals</Text>
        <ScrollView horizontal pagingEnabled showsHorizontalScrollIndicator={false}>
          <View style={{...styles.deal, width: screenWidth}}>
            <Image source={require('../assets/ramen.jpg')} style={{...styles.blurImage, width: '100%'}} resizeMode='cover' />
            <Text style={styles.dealText}>Ramen</Text>
          </View>
          <View style={{...styles.deal, width: screenWidth}}>
            <Image source={require('../assets/ramen.jpg')} style={{...styles.blurImage, width: '100%'}} resizeMode='cover' />
            <Text style={styles.dealText}>Ramen</Text>
          </View>
          <View style={{...styles.deal, width: screenWidth}}>
            <Image source={require('../assets/ramen.jpg')} style={{...styles.blurImage, width: '100%'}} resizeMode='cover' />
            <Text style={styles.dealText}>Ramen</Text>
          </View>
          <View style={{...styles.deal, width: screenWidth}}>
            <Image source={require('../assets/ramen.jpg')} style={{...styles.blurImage, width: '100%'}} resizeMode='cover' />
            <Text style={styles.dealText}>Ramen</Text>
          </View>
          <View style={{...styles.deal, width: screenWidth}}>
            <Image source={require('../assets/ramen.jpg')} style={{...styles.blurImage, width: '100%'}} resizeMode='cover' />
            <Text style={styles.dealText}>Ramen</Text>
          </View>
          <View style={{...styles.deal, width: screenWidth}}>
            <Image source={require('../assets/ramen.jpg')} style={{...styles.blurImage, width: '100%'}} resizeMode='cover' />
            <Text style={styles.dealText}>Ramen</Text>
          </View>
          {/* Add more deals as needed */}
        </ScrollView>
      </View>

      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Most Popular</Text>
        <View style={styles.popular}>
          <Image source={require('../assets/ramen.jpg')} style={styles.image} resizeMode='cover' />
          <View style={styles.popularInfo}>
            <Text style={styles.popularName}>Salad</Text>
            <Text style={styles.popularPrice}>$10</Text>
          </View>
        </View>
        {/* Add more popular items as needed */}
      </View>
    </ScrollView>
      <View>{MyTabs()}</View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
  section: {
    margin: 10,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  category: {
    marginTop: 5,
    marginRight: 25,
    alignItems: 'center',
  },
  roundImage: {
    width: 73,
    height: 73,
    borderRadius: '50%',
  },
  deal: {
    marginRight: 10,
    alignItems: 'center',
    justifyContent: 'center',
  },
  blurImage: {
    height: 200,
    opacity: 0.8,
  },
  dealText: {
    position: 'absolute',
    color: '#fff',
    fontSize: 18,
    fontWeight: 'bold',
  },
  popular: {
    width: '95%',
    marginBottom: 10,
    alignItems: 'center',
    margin: 'auto',
  },
  image: {
    width: '100%',
    height: 180,
    aspectRatio: 1,
  },
  popularInfo:{
    flexDirection: 'row',
    width: '100%',
   },
   popularName:{
    width: '50%',
     textAlign: 'left',
     fontSize :16, 
     fontWeight:'bold'
   },
   popularPrice:{
     width: '50%',
     textAlign: 'right',
     fontSize :16, 
     fontWeight:'bold'
   }
});

export default HomeScreen;
